import React from 'react';

import styled from "styled-components";

const Page2 = () => {
  return (
    <>
      <Container>
    <div>
      <h1>Page 2</h1>
    </div>
    </Container>
    </>
  );
};
const Container = styled.div`
  height: 100vh;
  width: 100vw;
  display: flex;
  flex-direction: column;
  justify-content: center;
  gap: 1rem;
  align-items: center;
  background-color: #131324;
  
`;

export default Page3;
